package com.SmartHealthcare.configs;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.context.annotation.Bean;
import org.springframework.context.annotation.Configuration;
import org.springframework.security.authentication.AuthenticationManager;
import org.springframework.security.authentication.AuthenticationProvider;
import org.springframework.security.authentication.dao.DaoAuthenticationProvider;
import org.springframework.security.config.annotation.authentication.configuration.AuthenticationConfiguration;
import org.springframework.security.config.annotation.method.configuration.EnableMethodSecurity;
import org.springframework.security.config.annotation.web.builders.HttpSecurity;
import org.springframework.security.config.annotation.web.configuration.EnableWebSecurity;
import org.springframework.security.config.http.SessionCreationPolicy;
import org.springframework.security.core.userdetails.UserDetailsService;
import org.springframework.security.crypto.bcrypt.BCryptPasswordEncoder;
import org.springframework.security.crypto.password.PasswordEncoder;
import org.springframework.security.web.SecurityFilterChain;
import org.springframework.security.web.authentication.UsernamePasswordAuthenticationFilter;

import com.SmartHealthcare.helpers.UserDetailsServiceImpl;

@Configuration
@EnableWebSecurity
@EnableMethodSecurity
public class SecurityConfig {

    @Autowired
    JwtAuthFilter jwtAuthFilter;

    @Bean
    public UserDetailsService userDetailsService() {
        return new UserDetailsServiceImpl();
    }

    @Bean
    public SecurityFilterChain securityFilterChain(HttpSecurity http) throws Exception {
        return http.csrf(csrf -> csrf.disable())
                .authorizeHttpRequests(requests -> requests.anyRequest().permitAll())
                // .authorizeHttpRequests(requests -> requests
                //         .requestMatchers("/api/user/register", "/api/user/login",
                //                 "/api/user/refreshToken",
                //                 "/api/user/gender", "/api/user/roles", "/api/patient/**",
                //                 "/api/doctor/register")
                //         .permitAll())
                .authorizeHttpRequests(requests -> requests.requestMatchers("/api/**")
                        .authenticated())
                .sessionManagement(management -> management
                        .sessionCreationPolicy(SessionCreationPolicy.STATELESS))
                .authenticationProvider(authenticationProvider())
                .addFilterBefore(jwtAuthFilter, UsernamePasswordAuthenticationFilter.class).build();
    }

    @Bean
    public PasswordEncoder passwordEncoder() {
        return new BCryptPasswordEncoder();
    }

    @Bean
    public AuthenticationProvider authenticationProvider() {
        DaoAuthenticationProvider authenticationProvider = new DaoAuthenticationProvider();
        authenticationProvider.setUserDetailsService(userDetailsService());
        authenticationProvider.setPasswordEncoder(passwordEncoder());
        return authenticationProvider;

    }

    @Bean
    public AuthenticationManager authenticationManager(AuthenticationConfiguration config) throws Exception {
        return config.getAuthenticationManager();
    }

}

#include <cmath>
#include <cstdio>
#include <vector>
#include <iostream>
#include <algorithm>
#include <unordered_map>
#include <set>

using namespace std;

void dfs(unordered_map<int, set<int>>& graph, vector<bool>& visited, int start){
    visited[start] = true;
    for(int neighbour : graph[start]){
        if(!visited[neighbour])
            dfs(graph, visited, neighbour);
    }
}

int test(){
    int x, y, a, b;
    cin >> x >> y;
    vector<bool> visited(x, false);
    unordered_map<int, set<int>> graph;
    for(int i = 0; i < y; i++){
        cin >> a >> b;
        graph[a].insert(b);
        graph[b].insert(a);
    }
    
    int counter = 0;
    for(int i = 0; i < x; i++){
        if(!visited[i]){
            counter++;
            dfs(graph, visited, i);
        }
    }
    return counter;
}

int main() {
    int t;
    cin >> t;
    for(int i = 0; i < t; i++){
        cout << test() << " ";
    }
    return 0;
}

#include <stdio.h>

struct Undef {
public:
	Undef(){
		width++; //set type width. This is how much the address shifts using ++ --
	}
	bool* addr=0x0; //store data in form of address
	bool* width=0x0; 
	void inc(){
		addr++;
	}
	void dec(){
		addr--;
	}
	bool* operator()(){
		return addr;
	}
};


class Constants{
public:
	Constants(){ //set constants
		placeholder.addr--;
		inf=placeholder.addr;
	}
	Undef placeholder;
	
	bool* zero=0x0;
	bool* inf=0x0;
};


class UndefMngr{
public:
	Constants vof;
	Undef add(Undef num){
		Undef inc=num;
		while(inc.addr>vof.zero){
			num.inc();
			inc.dec();
		}
		return num;
	}
	Undef sq(Undef num){ //doubling
		Undef inc=num;
		while((void*)inc.addr>vof.zero){
			num=add(num);
			inc.dec();
		}
		return num;
	}
	Undef sq16(Undef num){ //doubling double
		Undef inc=num;
		while((void*)inc.addr>vof.zero){
			num=sq(num);
			inc.dec();
		}
		return num;
	}
	Undef sub(Undef value, Undef subtractor){ //subtract
		Undef dec=subtractor;
		while((void*)dec.addr>vof.zero){
			value.dec();
			dec.dec();
		}
		return value;
	}
};

int main(){

	UndefMngr math;
	Undef num;

	printf("Zero %p\n", (void*)math.vof.zero );
	printf("Infinity %p\n", (void*)math.vof.inf );

	printf("width %p\n", (void*)num.width );
	num.inc();
	printf("num+1 %p\n", (void*)num.addr );
	num=math.sq(num);
	printf("num doubled %p\n", (void*)num.addr );
	Undef num2 = num;
	num=math.sq16(num);
	printf("num doubled double %p\n", (void*)num.addr );

	Undef result = math.sub(num,num2);
	printf("subtracted %p from %p resulting in %p\n", (void*)num.addr, (void*)num2.addr, (void*)result.addr );


	return 0;
}
/*Output

Zero (nil)
Infinity 0xffffffffffffffff
width 0x1
num+1 0x1
num doubled 0x2
num doubled double 0x800
subtracted 0x800 from 0x2 resulting in 0x7fe
*/

#include <cmath>
#include <cstdio>
#include <vector>
#include <iostream>
#include <algorithm>
#include <unordered_map>

using namespace std;

bool hasCycle(unordered_map<int, vector<int>>& graph, vector<bool>& visited, vector<bool> pathVisited, int idx) {
    if(pathVisited[idx])
        return true;
    pathVisited[idx] = true;
    for(auto neighbour : graph[idx]){
        if(hasCycle(graph, visited, pathVisited, neighbour))
            return true;
    }
    pathVisited[idx] = false;
    visited[idx] = true;
    return false;
    
}

bool test(){
    int v, e, x, y, w;
    cin >> v >> e;
    unordered_map<int, vector<int>> graph;
    for(int i = 0; i < e; i++){
        cin >> x >> y >> w;
        graph[x - 1].push_back(y - 1);
    }
    vector<bool> visited(v, false);
    
    for(int i = 0; i < v; i++) {
        if(!visited[i]){
            vector<bool> pathVisited(v, false);
            if(hasCycle(graph, visited, pathVisited, i)){
                return true;
            }
        }
    }
    return false;
}


int main() {
    int n;
    cin >> n;
    for(int i = 0; i < n; i++){
        if(test())
            cout << "true" << " ";
        else
            cout << "false" << " ";
    }
    return 0;
}

